import React, {useState} from 'react';

class TitlePage extends React.Component {
  render() {
    return (
      <div class="header">
        <p>></p>
        <div class="justinsantos">
          <span class="ju"></span>
          <span class="stinsan"></span>
          <span class="tos"></span>
          <span class="blinking-underscore">_</span>
        </div>
      </div>
    );
  }
}

export default TitlePage;
